column3:
Размеры: 15х20,7х1,8 см;
Переплет твердый;
Обложка кашированная, матовая, ламинация софт-тач, закругленные углы - на фото серая, считаем серый материал;
Печать логотипа в край на обложке;
Блок недатированный, в линейку стандартный, цветность 1/1;
Бумага белоснежная, плотность не менее 80 г/м2;
Форзац и нахзац черные ;
Тип нанесения: уф-печать;
Количество страниц: 256;
Упаковка в термоусадку
